import React from 'react';
const Services = () =>{
return (<div>
    <div>
    {/* Titles - 1st Row */}
        <h2>Envelopes</h2><h2>Post Cards</h2><h2>Business Cards</h2>
    </div>

    <div>
{/* Images - 1st Row */}
        <img ></img> <img></img> <img></img>
    </div>

    <div>
        {/* Titles - 2nd Row */}
        <h2>Note Pads</h2><h2>Digital Copies</h2><h2>Letterheads</h2>
    </div>
    <div>
        {/* Images - 2nd Row */}
        <img src="Assets/WashU_Icons_Page_5-1024x731.jpeg" /> <img></img> <img src = "/Assets/WashU_Icons_Page_4-1024x731.jpeg" />
    </div>
    <div>
        {/* Titles - 3rd Row */}
        <h2>Large Format</h2><h2>Yard Signs</h2><h2>Booklets</h2>
    </div>
    <div>
        {/* Images - 3rd Row */}
        <img></img> <img></img> <img></img>
    </div>
</div>)
}
export default Services
